import React from 'react';
import {
  Box,
  Typography,
  IconButton,
  useTheme,
  Container,
} from '@mui/material';
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import TwitterIcon from '@mui/icons-material/Twitter';
import Pic from '../pic.jpg';
import { motion } from 'framer-motion';

interface AuthorProps {
  darkMode: boolean;
}

const Author: React.FC<AuthorProps> = ({ darkMode }) => {
  const theme = useTheme();

  const sectionTitleStyle = {
    mb: 2,
    fontWeight: 'bold',
    color: darkMode ? '#9575cd' : '#673ab7',
    borderBottom: `3px dotted ${darkMode ? '#ffffff' : '#333333'}`,
    display: 'inline-block',
    textAlign: 'left',
    paddingBottom: '6px',
  };

  const techStack = [
    'C++',
    'JavaScript',
    'React',
    'Node.js',
    'MongoDB',
    'SQL',
    'Python',
    'Git',
    'HTML/CSS',
    'Express',
  ];

  return (
    <Box
      sx={{
        flexGrow: 1,
        bgcolor: darkMode ? '#1a1a1a' : '#f5f5f5',
        minHeight: '100vh',
        color: darkMode ? '#e0e0e0' : '#333333',
        py: 8,
        px: 2,
      }}
    >
      <Container
        maxWidth="md"
        sx={{
          bgcolor: darkMode ? '#212121' : '#ffffff',
          p: { xs: 4, md: 6 },
          borderRadius: 3,
          boxShadow: 6,
          textAlign: 'center',
        }}
      >
        {/* Profile Section */}
        <Box sx={{ mb: 6 }}>
          <motion.div animate={{ y: [0, -5, 0], transition: { duration: 3, repeat: Infinity, ease: "easeInOut" } }}>
            <Box
              component="img"
              src={Pic}
              alt="Subham Kumar"
              sx={{
                width: 180,
                height: 180,
                borderRadius: '50%',
                objectFit: 'cover',
                mb: 3,
                border: `5px solid ${darkMode ? '#424242' : '#e0e0e0'}`,
                boxShadow: 3,
              }}
            />
          </motion.div>
          <Typography variant="h3" component="h1" gutterBottom sx={{ fontWeight: 'bold' }}>
            Hi there! I'm Subham.
          </Typography>
          <Typography variant="h6" paragraph sx={{ fontStyle: 'italic' }}>
            I started building on the web in 2007 and never stopped.
          </Typography>
        </Box>

        {/* Bio */}
        <Box sx={{ mb: 6, maxWidth: '800px', mx: 'auto', textAlign: 'left' }}>
          <Typography variant="body1" paragraph sx={{ lineHeight: 1.8 }}>
            I've worked in senior engineering positions at organizations like Gatsby (acq. Netlify), DigitalOcean, and Khan Academy. I've also taught web development fundamentals at Concordia University.
          </Typography>
          <Typography variant="body1" paragraph sx={{ lineHeight: 1.8 }}>
            These days, I'm a solo indie hacker focused on empowering up-and-coming software developers.
          </Typography>
        </Box>

        {/* Work Experience */}
        <Typography variant="h5" sx={sectionTitleStyle}>
          üíº Work Experience
        </Typography>

        <Box sx={{ display: 'flex', flexDirection: 'column', gap: 4, mb: 6, pl: 1, textAlign: 'left' }}>
          {[
            {
              role: 'Frontend Engineer Intern',
              company: 'Sportthon',
              date: 'Jan 2025 ‚Äì Mar 2025',
              tech: 'React, CSS, REST API, MySQL',
              color: darkMode ? '#66bb6a' : '#4caf50',
            },
            {
              role: 'Open Source Contributor',
              company: 'Self-Directed',
              date: 'Dec 2023 ‚Äì Apr 2024',
              tech: 'Projects: Metamask, CircuitVerse, OpenMRS',
              color: darkMode ? '#ffa726' : '#ff9800',
            },
            {
              role: 'Open Source Mentor',
              company: 'CircuitVerse',
              date: 'May 2024 ‚Äì Aug 2024',
              tech: 'Guided contributors, reviewed PRs, improved docs',
              color: darkMode ? '#0288d1' : '#03a9f4',
            },
          ].map((exp, idx) => (
            <motion.div
              key={idx}
              initial={{ opacity: 0, x: -20 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.5 + idx * 0.2 }}
            >
              <Box sx={{ display: 'flex', alignItems: 'flex-start' }}>
                <Typography
                  sx={{
                    fontWeight: 'bold',
                    mr: 2,
                    mt: '4px',
                    color: exp.color,
                    minWidth: '30px',
                  }}
                >
                  ‚óè ‚Üí
                </Typography>
                <Box>
                  <Typography variant="h6" sx={{ fontWeight: 'medium' }}>
                    {exp.role}
                  </Typography>
                  <Typography variant="subtitle1" sx={{ fontStyle: 'italic' }}>
                    {exp.company}
                  </Typography>
                  <Typography variant="body2" sx={{ mb: 0.5 }}>
                    {exp.date}
                  </Typography>
                  <Typography variant="body2" sx={{ fontWeight: 'bold' }}>
                    {exp.tech}
                  </Typography>
                </Box>
              </Box>
            </motion.div>
          ))}
        </Box>

        {/* Education */}
        <Typography variant="h5" sx={sectionTitleStyle}>
          üéì Education
        </Typography>
        <Box sx={{ textAlign: 'left', mb: 6, pl: 1 }}>
          <Typography variant="h6" sx={{ fontWeight: 'bold' }}>
            Integrated Master of Technology (B.Tech + M.Tech)
          </Typography>
          <Typography variant="subtitle1" sx={{ fontStyle: 'italic' }}>
            in Mathematics and Computing
          </Typography>
          <Typography variant="body2">Dec 2021 - April 2026</Typography>
        </Box>

        {/* Tech Stack */}
        <Typography variant="h5" sx={sectionTitleStyle}>
          üß∞ Tech Stack
        </Typography>
        <Box
          sx={{
            overflow: 'hidden',
            width: '100%',
            position: 'relative',
            mb: 6,
            height: '60px',
          }}
        >
          <motion.div
            animate={{ x: ['100%', '-100%'] }}
            transition={{ repeat: Infinity, duration: 18, ease: 'linear' }}
            style={{ whiteSpace: 'nowrap', display: 'inline-block' }}
          >
            {techStack.map((tech, index) => (
              <Box
                key={index}
                sx={{
                  display: 'inline-block',
                  bgcolor: darkMode ? '#424242' : '#e0e0e0',
                  color: darkMode ? '#ffffff' : '#333',
                  px: 2,
                  py: 1,
                  mx: 1.5,
                  borderRadius: '20px',
                  fontWeight: 500,
                  fontSize: '14px',
                  boxShadow: 2,
                  minWidth: '80px',
                  textAlign: 'center',
                  userSelect: 'none',
                }}
              >
                {tech}
              </Box>
            ))}
          </motion.div>
        </Box>

        {/* Social Links */}
        <Typography variant="h5" sx={sectionTitleStyle}>
          üåê Find me on
        </Typography>
        <Box sx={{ textAlign: 'center', mb: 6 }}>
          <IconButton href="https://github.com/yourusername" target="_blank" sx={{ color: darkMode ? '#bdbdbd' : '#666666', '&:hover': { color: darkMode ? '#ffffff' : '#333333', transform: 'scale(1.2)' }, m: 1 }}>
            <GitHubIcon fontSize="large" />
          </IconButton>
          <IconButton href="https://linkedin.com/in/yourusername" target="_blank" sx={{ color: darkMode ? '#bdbdbd' : '#666666', '&:hover': { color: darkMode ? '#ffffff' : '#333333', transform: 'scale(1.2)' }, m: 1 }}>
            <LinkedInIcon fontSize="large" />
          </IconButton>
          <IconButton href="https://twitter.com/yourusername" target="_blank" sx={{ color: darkMode ? '#bdbdbd' : '#666666', '&:hover': { color: darkMode ? '#ffffff' : '#333333', transform: 'scale(1.2)' }, m: 1 }}>
            <TwitterIcon fontSize="large" />
          </IconButton>
        </Box>
      </Container>
    </Box>
  );
};

export default Author;
